import React from "react";
import style from "./NavigationItems.module.css";
import {NavLink} from "react-router-dom";

// NavLink is rendered as <a> in HTML and will add "active" class but
// active is attached with activeClassName due to use of CSS moduels
// "To" is treated like a prefix unless you use exact

const NavigationItems = (props) =>{
    return(
        <ul className={style.NavigationItems}>

            <li >
                <NavLink to="/" activeClassName={style.active}>
                    <i className="fab fa-github-square"></i>About
                </NavLink>
            </li>

            <li >
                <NavLink to="/portfolio" activeClassName={style.active}>
                    <i className="fab fa-github-square"></i>Portfolio
                </NavLink>
            </li>

            <li className={style.NavigationItem}>
                <a className="nav-icon nav-icon1" href="https://github.com/SigmaVX" target="_blank" rel="noopener noreferrer">
                    <i className="fab fa-github-square"></i>GitHub
                </a>
            </li>

            <li className={style.NavigationItem}>
                <a className="nav-icon" href="https://www.linkedin.com/in/tonywible/" target="_blank" rel="noopener noreferrer">
                    <i className="fab fa-linkedin"></i>LinkedIn
                </a>
            </li>

            <li className={style.NavigationItem}>
                <a className="nav-icon" href="mailto: [tonywible@gmail.com]">
                    <i className="fas fa-envelope"></i> Mail
                </a>   
            </li>
        </ul>
    );
};

export default NavigationItems;

